
CREATE TABLE retail_sales_data (
    OrderID VARCHAR(15),
    OrderDate DATE,
    CustomerName VARCHAR(50),
    Region VARCHAR(20),
    CustomerType VARCHAR(20),
    Category VARCHAR(30),
    Product VARCHAR(50),
    SalesChannel VARCHAR(20),
    UnitsSold INT,
    UnitPrice DECIMAL(10,2),
    TotalRevenue DECIMAL(10,2)
);

